import "../App.css"

export default function CountryInfo({ countries }) {
  return (
    <>
      <p><b>Name: </b><span>{countries.country_name}</span></p>
      <p><b>Calling Code: </b><span>{countries.calling_code}</span></p>
      <p><b>Capital: </b><span>{countries.capital}</span></p>
      <p><b>Region: </b><span>{countries.region}</span></p>
    </>
  )
}
